export const Counter_Incriment="counter/increment"
export const Counter_decrement="counter/increment"
export const CounterRedux = (state = { value: 0 }, action) => {
 switch (action.type) {
  case 'counter/increment':
   return { value: state.value + 1 };
  case 'counter/decrement':
   return { value: state.value - 1 };
  default:
   return state;
 }
};
